import React from "react";

const apiUrl = 'https://api.eventplanner.net/pages';
const apiKey = '0011223344556677889900aab';

fetch(apiUrl, {
  method: 'GET',
  headers: {
    'X-API-KEY': apiKey,
  },
})
  .then(response => {
    if (!response.ok) {
      throw new Error(`HTTP error! Status: ${response.status}`);
    }
    return response.json();
  })
  .then(data => {
    // Handle the response data
    console.log(data);
  })
  .catch(error => {
    // Handle errors
    console.error('Error fetching data:', error.message);
  });


